contracts/SimpleStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

contract SimpleStrage{
    uint256 my_integer = 10;
    bool my_boolean = true;
    string my_string = "Hello, World!";
    address my_address = 0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2;
    bytes my_byes = "Hello, World!";

    uint256 public favoriteNumber;
    struct People{
        uint256 favoriteNumber;
        string name;
    }
    People[] public people; //ni array struct
    function addPerson(uint256 _favoriteNumber, string memory _name) public{
        people.push(People(_favoriteNumber, _name));
    }

    People public person = People({favoriteNumber: 15, name:"ara"});

    function store(uint256 _favoriteNumber) public{
        favoriteNumber = _favoriteNumber;
    }
}

